    //{filteredExpenses.length === 0 && <p>No expenses found</p>}
  
    if (props.items.length > 0) {
      expenseFilterContent = props.items.map((outlays) => (
        <ExpenseItem
          key={outlays.id}
          title={outlays.title}
          amount={outlays.amount}
          date={outlays.date}
        />
      ));
    }
    return 
};

export default ExpensesList;
